function rot_aa_mat3(axis, angle) {
    let c = Math.cos(angle);
    let s = Math.sin(angle);

    let x = axis[0];
    let y = axis[1];
    let z = axis[2];

    return [
        x * x * (1 - c) + c,
        x * y * (1 - c) - z * s,
        x * z * (1 - c) + y * s,

        y * x * (1 - c) + z * s,
        y * y * (1 - c) + c,
        y * z * (1 - c) - x * s,

        z * x * (1 - c) - y * s,
        z * y * (1 - c) + x * s,
        z * z * (1 - c) + c,
    ];
}

