function vec_norm(a) {
    let d = 0;
    for (let i = 0; i < a.length; i++)
        d += a[i] * a[i];

    d = 1.0 / Math.sqrt(d);
    let r = new Array(a.length);
    if (d < 1e-20) {
        for (let i = 0; i < a.length; i++)
            r[i] = 0;
