}


function lerp(a, b, f) {
    if (f == 0)
        return a;
    else if (f == 1)
        return b;

    return a * (1 - f) + b * f;
}

function smooth_lerp(a, b, f) {
    if (f == 0)
        return a;
    else if (f == 1)
        return b;

    f = f * f * (3.0 - 2.0 * f);

    return a * (1 - f) + b * f;
}

function saturate(x) {
