            else
                inst_ext.drawArraysInstancedANGLE(gl.TRIANGLES, 0, 12, count);

            for (let i = 0; i < 4; i++) {
                inst_ext.vertexAttribDivisorANGLE(shader.attributes[attrib_names[i]], 0);
            }

