                return int(365.25 * (y + 4716)) + int(30.6 * (m + 1)) + d + b - 1524.5;
            }


            function bisect(a, b, f) {
                let fa = f(a);

                for (let i = 0; i < 30; i++) {
                    let mid = (a + b) / 2;
                    let fmid = f(mid);

                    if (Math.abs(fmid) < 0.000001)
                        return mid;

                    if ((fmid > 0 && fa > 0) || (fmid < 0 && fa < 0)) {
                        a = mid;
                        fa = f(a);
                    } else {
                        b = mid;
                    }
                }

                return a;
            }

